export default {
  setFetching(fetching) {
    return {
      type: 'SET_FETCHING',
      payload: fetching
    }
  },

  setError(error) {
    return {
      type: 'SET_ERROR',
      payload: error
    }
  },
  
  setData({ data, totalPages }) {
    return {
      type: 'SET_DATA',
      payload: { data, totalPages }
    }
  },

  setDataById(dataById) {
    return {
      type: 'SET_DATA_BY_ID',
      payload: dataById
    }
  },
  
  setTotalPages(totalPages) {
    return {
      type: 'SET_TOTAL_PAGES',
      payload: totalPages
    }
  }
}
